import React from "react";
import { rutaAPI } from "../../../config/Config";
import $, { data } from "jquery";

export default function Administradores() {
  const dataProspectos = async () => {
    const getProspectos = await getData();

    console.log("getProspectos", getProspectos);
  };

  dataProspectos();

  return (
    <div className="content-wrapper" style={{ minHeight: "494px" }}>
      <div className="content-header">
        <div className="container-fluid">
          <div className="row mb-2">
            <div className="col-sm-6">
              <h1 className="mb-0 text-dark">Prospectos</h1>
            </div>
          </div>
        </div>
      </div>

      <div className="content">
        <div className="container-fluid">
          <div className="row">
            <div className="col-lg-12">
              <div className="col-lg-12">
                <div className="card card-primary card-outline">
                  <div className="card-header">
                    <h5 className="m-0">
                      <button className="btn btn-primary">
                        Agregar Nuevo Prospecto
                      </button>
                    </h5>
                  </div>
                  <div className="card-body">
                    <table
                      className="table table-striped"
                      style={{ width: "100%" }}
                    >
                      <thead>
                        <tr>
                          <th>#</th>
                          <th>Nombre</th>
                          <th>Calle</th>
                          <th>Colonia</th>
                          <th>Código Postal</th>
                          <th>Teléfono</th>
                          <th>RFC</th>
                          <th>Acciones</th>
                        </tr>
                      </thead>
                      <tbody>
                        <tr>
                          <td>1</td>
                          <td>Jose Beltran Lopez</td>
                          <td>Eutimio B.Gomez #3431</td>
                          <td>Guadalupe Victoria</td>
                          <td>80240</td>
                          <td>6671609992</td>
                          <td>VISJOISOJASFDOIA</td>
                          <td>
                            <div className="btn-group">
                              <button className="btn btn-warning rounded-circle mr-2">
                                <i className="nav-icon fas fa-pencil-alt"></i>
                              </button>

                              <button className="btn btn-danger rounded-circle">
                                <i className="nav-icon fas fa-trash"></i>
                              </button>
                            </div>
                          </td>
                        </tr>
                      </tbody>
                    </table>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

/*===============================================================
PETICION DE TODOS LOS PROSPECTOS
===============================================================*/

const getData = () => {
  const url = `${rutaAPI}/mostrar-prospecto`;

  const params = {
    method: "GET",
    headers: {
      "Content-Type": "application/json",
    },
  };

  return fetch(url, params)
    .then((response) => {
      return response;
    })
    .catch((err) => {
      return err;
    });
};
